import React from 'react';
import ReactDom from 'react-dom';
import picAtom from '../Images/Atom.png'
function Header(){
    return <div className='navbar'>
        <div className='inner'>
            <img className="logo" src={picAtom}/>
        </div>
        
    </div>
}

export default Header;
